import React from 'react';
import { Box, useTheme } from '@mui/material';

const ECGWave = () => {
  const theme = useTheme();
  return (
    <Box
      sx={{
        height: 200,
        bgcolor: theme.palette.background.paper,
        borderRadius: 1,
        overflow: 'hidden',
        position: 'relative',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          background: `linear-gradient(
            to right,
            rgba(${theme.palette.primary.main}, 0.1) 0%,
            rgba(${theme.palette.primary.main}, 0.2) 50%,
            rgba(${theme.palette.primary.main}, 0.1) 100%
          )`,
          animation: 'ecgWave 2s linear infinite'
        }
      }}
    />
  );
};

export default ECGWave;
